import React, {  useState } from "react";



const Popup = ({ ...props }) => {
const { closeoption, checkcall ,message} = props;
//const [popmenu,setPopmenu]=useState(true);

  return (
    <div>
      <div className="card_layout">
        <p>{message}</p>
        <button onClick={()=>{ closeoption(false);checkcall(false) }}>Close</button>
        <button onClick={()=>{ closeoption(false);checkcall(true) }}>Continue</button>

      </div>

    </div>
  );
};

export default Popup;
